import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { TransactionFormComponent } from './transactionForm.componen';
import { TransactionListComponent } from './transactionList.component';

const routes: Routes = [
  { path: 'transactions', component: TransactionListComponent },
  { path: 'add-transaction', component: TransactionFormComponent },
  { path: '', redirectTo: '/transactions', pathMatch: 'full' }, // Default route
  { path: '**', redirectTo: '/transactions' } // Wildcard route for unknown paths
];
@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
